import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import Navbar from '../components/Navbar';
import FilterBar from '../components/FilterBar';
import NextBusCard from '../components/NextBusCard';

const HomeContainer = styled.div`
  background-color: #f5f5f5;
  min-height: 100vh;
  padding: 2rem;
`;

const ContentWrapper = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 300px;
  gap: 2rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const MainContent = styled.div`
  display: flex;
  flex-direction: column;
  gap: 2rem;
`;

const Title = styled.h1`
  color: #002B5C;
  text-align: center;
  font-family: 'Inter', sans-serif;
  font-size: 2.5rem;
  margin-bottom: 1rem;
`;

const WeatherCard = styled.div`
  background: white;
  border-radius: 12px;
  padding: 1.5rem;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.1);
  height: fit-content;
`;

const WeatherHeader = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  margin-bottom: 1rem;
`;

const WeatherTitle = styled.h2`
  color: #002B5C;
  font-size: 1.2rem;
  margin: 0;
`;

const WeatherInfo = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.5rem;
`;

const WeatherDetail = styled.div`
  display: flex;
  justify-content: space-between;
  color: #666;
  font-size: 0.9rem;
`;

const WeatherValue = styled.span`
  color: #002B5C;
  font-weight: 500;
`;

const Temperature = styled.div`
  font-size: 2.5rem;
  color: #002B5C;
  font-weight: 600;
  text-align: center;
  margin: 1rem 0;
`;

const WeatherIcon = styled.div`
  font-size: 2rem;
  text-align: center;
  margin: 1rem 0;
`;

const Home = () => {
  const [weather, setWeather] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchWeather = async () => {
      try {
        // Replace with your actual weather API key and endpoint
        const response = await fetch(
          `https://api.openweathermap.org/data/2.5/weather?q=Oswego,NY,US&units=imperial&appid=YOUR_API_KEY`
        );
        const data = await response.json();
        setWeather(data);
      } catch (error) {
        console.error('Error fetching weather:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchWeather();
  }, []);

  return (
    <HomeContainer>
      <Navbar />
      <ContentWrapper>
        <MainContent>
          <Title>CENTRO BUS PREDICTOR</Title>
          <FilterBar />
          <NextBusCard route="" direction="" stop="" nextArrival="" />
        </MainContent>

        <WeatherCard>
          <WeatherHeader>
            <WeatherTitle>Oswego, NY Weather</WeatherTitle>
          </WeatherHeader>

          {loading ? (
            <div>Loading weather data...</div>
          ) : weather ? (
            <>
              <WeatherIcon>
                {/* Add weather icon based on weather condition */}
                ☀️
              </WeatherIcon>
              <Temperature>
                {Math.round(weather.main.temp)}°F
              </Temperature>
              <WeatherInfo>
                <WeatherDetail>
                  <span>Feels Like</span>
                  <WeatherValue>{Math.round(weather.main.feels_like)}°F</WeatherValue>
                </WeatherDetail>
                <WeatherDetail>
                  <span>Humidity</span>
                  <WeatherValue>{weather.main.humidity}%</WeatherValue>
                </WeatherDetail>
                <WeatherDetail>
                  <span>Wind</span>
                  <WeatherValue>{Math.round(weather.wind.speed)} mph</WeatherValue>
                </WeatherDetail>
              </WeatherInfo>
            </>
          ) : (
            <div>Unable to load weather data</div>
          )}
        </WeatherCard>
      </ContentWrapper>
    </HomeContainer>
  );
};

export default Home;
